const {loginApi} = require('../api/login');
const loginForm = (email, password, setToken, setUserData, setErrorMessage) => {
    if(!email || !password){
        return false;
    }
    const data = {
        email,
        password
    }
    const responseState = loginApi(data);
    return responseState;

}
module.exports = {loginForm};
